import React from 'react';
import './Nav.css';


const Nav = () =>{
    return(
        <ul className="navContainer">
            <li>Home</li>
            <li>About</li>
            <li>Work</li>
            <li>Contact</li>
        </ul>
    )
}

export default Nav;
